import React from 'react'

const LeaderboardTable = props =>{
    var rank =1;
    return(

        <div>
            console.log(props.playerScores)
            <h1>Sub Leaderboard : {props.instance}</h1>
            <table border={1}>
            <thead><th>Rank</th><th>Player</th><th>Score</th></thead>
            <tbody>
            {props.players.map((player)=>{
                return <tr><td>{rank++}</td><td>{player}</td><td>{props.playerScores}</td></tr>
            })}
            </tbody>
        </table>
        </div>
    )
}

export default LeaderboardTable
